// learn-to-code/src/pages/Home/Home.js

import React from 'react';
import Navbar from '../../assets/components/Navbar/Navbar';
import Footer from '../../assets/components/Footer/Footer';
import DarkModeToggle from '../../assets/components/DarkModeToggle/DarkModeToggle';

function Home() {
    return (
        <div className="Home-container">
            <header className="header">
                <h1 className="fade-in-header"> Welcome to the Python Tutorial!</h1>
                <DarkModeToggle />
            </header>
            <Navbar />
            <main className="main-content">
                <img
                    src="your-image-here.jpg"
                    alt="python tutorial banner"
                    className="centered-image"
                />
            </main>
            <Footer />
        </div>
    );
}

export default Home;
